import hexdump
from Crypto.Cipher import ARC4 as rc4cipher
import lz4.block
import lz4.frame
import json


content_1 = ""

context_2 = ""

data = bytes.fromhex(content_1+context_2)
# data = bytes.fromhex(test)
rc4_key = b"a308f3628b3f39f7d35cdebeb6920e21"
enc = rc4cipher.new(rc4_key)
res = enc.decrypt(data)[24:]
print(hexdump.hexdump(res))
deccom = bytearray()

mag = "04 22 4D 18 60 40 82".replace(" ", "")
mag_byte = bytes.fromhex(mag)
deccom.extend(mag_byte)

content_len = len(res)

deccom.extend(content_len.to_bytes(4, byteorder='little'))
deccom.extend(res)
deccom.extend(b'\x00\x00\x00\x00')


print(hexdump.hexdump(deccom))

compressed = lz4.frame.decompress(deccom)

json_data = json.loads(compressed)

print(json_data)